import { makeStyles } from "@mui/styles";

const WelcomeStyle = makeStyles({
    Content: {
        height: "100%",
        userSelect: "none",
        display: "flex",
        flexDirection: "Column",
        alignItems: "center",
        justifyContent: "center",
        verticalAlign: "middle",
    },
    Image:{
        pointerEvents: "none",
    }
})

export default WelcomeStyle;
